import * as React from "react";
import { useForm } from "react-hook-form";
import Headers from "./Header";
import "./styles.css";

let renderCount = 0;

type FormValues = {
  date: number;
  tradeid: string;
  clientid: string;
};

export default function App() {
  const {
    register,
    handleSubmit,
    formState: { errors }
  } = useForm<FormValues>();

  return (
    <form
      onSubmit={handleSubmit((data) => {
        console.log(data);
      })}
    >
      <Headers
        renderCount={renderCount}
        description="Please enter data into only one of the search fields."
      />
      <label htmlFor="date">Query by Date:</label>
      <input
        type="number"
        {...register("date", { valueAsNumber: true,
          maxLength: { value: 8, message: "Input date as YYYYMMDD." }
        })}
        id="date"
      />
      {errors.date && <p>{errors.date.message}</p>}

      <label htmlFor="tradeid">Query by TradeID:</label>
      <input
        {...register("tradeid", {
          maxLength: { value: 4, message: "You exceeded the max length" }
        })}
      />

      <label htmlFor="clientid">Query by ClientID</label>
      <input
        id="clientid"
      />

      <input type="submit" />
    </form>
  );
}
